                $(function() {
                    getInfo(conjunto);
                });
                function getInfo(id) {
                    $('#resultados-1').html('<div class="loading "><img src="img/gifs/cargando3.gif"/><br/><p class="color-resulr"><span>Un momento, por favor...</span></p></div>');
                    let href = "vermapita.php?id=" + id;
                    $.ajax({
                        url: href,
                        beforeSend: function() {
                            //$('#loader').show();
                        },
                        // return the result
                        success: function(result) {
                            $('#resultados-1').html(result);
                        },
                        complete: function() {
                            //$('#loader').hide();
                        },
                        error: function(jqXHR, testStatus, error) {
                            console.log(error);
                            alert("Página " + href + " NO se puede abrir. Error:" + error);
                            //$('#loader').hide();
                        },
                        timeout: 8000
                    });
                }
            }
    </script>

